import './../../styles/newsList.css';


export default function newList(props){
    return(
        <>

        <div className='newsList'>
            <ul>
                {props.results.map(result=>(
                        <li>result.ID</li>
                    ))
                }

                <li className="more">Mas</li>
            </ul>
        </div>
        </>
    )
}
